import requests
import json
import re
import os
import copy
from strings import ATTACHMENT_REQUEST_PROMPT

def get_compnames():
    resp = requests.get("http://localhost:3001/api/compnames", timeout=100)
    resp.raise_for_status()
    data = resp.json()
    # print(json.dumps(data, indent=2))
    # print(type(data))
    assert isinstance(data, list)
    return data

def convert_attachment_str_to_dicts(attachment_str: str) -> tuple[dict, list]:
    """
    This function converts a string like:
[START OF ATTACHMENT]
[START OF TRACE]
trace: true
selectedComponentNameList: ["GPU[1].L2Cache[6]", "GPU[1].L2Cache[5]", "GPU[1].L2Cache[7]", "GPU[1].DRAM[6]", "GPU[1].DRAM[7]", "GPU[1].SA[0].CU[0].VMem"]
startTime: 0.0001986188002891137
endTime: 0.0001996188002891137
[END OF TRACE]
[START OF CODE]
code: true
selectedGitHubRoutineKeys: ["GPU.L2Cache", "GPU.DRAM", "GPU.SA.CU.VMem"]
[END OF CODE]
[END OF ATTACHMENT]
    to a dictionary traceInfo and a list selectedGitHubRoutineKeys like:

    "traceInfo": {
        "startTime": 0.0001986188002891137,
        "endTime": 0.0001996188002891137,
        "selected": 6,
        "selectedComponentNameList": ["GPU[1].L2Cache[6]", "GPU[1].L2Cache[5]", "GPU[1].L2Cache[7]", "GPU[1].DRAM[6]", "GPU[1].DRAM[7]", "GPU[1].SA[0].CU[0].VMem"],
    },

    "selectedGitHubRoutineKeys": ["GPU.L2Cache", "GPU.DRAM", "GPU.SA.CU.VMem"]

    """
    def assert_markers(s: str):
        markers = [
            "[START OF ATTACHMENT]", "[END OF ATTACHMENT]",
            "[START OF TRACE]", "[END OF TRACE]",
            "[START OF CODE]", "[END OF CODE]"
        ]
        for m in markers:
            assert m in s, f"Missing marker: {m}"

    def section_between(s: str, start_mark: str, end_mark: str) -> str:
        start = s.index(start_mark) + len(start_mark)
        end = s.index(end_mark, start)
        return s[start:end]

    def find_json_array(substr: str, key: str):
        # locate first '[' after key and find its matching closing ']' ignoring brackets inside quotes
        key_idx = substr.find(key)
        if key_idx == -1:
            return None
        bracket_idx = substr.find('[', key_idx)
        if bracket_idx == -1:
            return None
        i = bracket_idx
        depth = 0
        in_str = False
        esc = False
        while i < len(substr):
            ch = substr[i]
            if esc:
                esc = False
            elif ch == '\\':
                esc = True
            elif ch == '"' or ch == "'":
                # toggle string status (only track if same quote char)
                quote_char = ch
                # enter string mode and walk until closing quote handling escapes
                i += 1
                while i < len(substr):
                    c2 = substr[i]
                    if c2 == '\\':
                        i += 2
                        continue
                    if c2 == quote_char:
                        break
                    i += 1
            if not in_str:
                if ch == '[':
                    depth += 1
                elif ch == ']':
                    depth -= 1
                    if depth == 0:
                        return substr[bracket_idx:i+1]
            i += 1
        return None

    assert_markers(attachment_str)

    trace_section = section_between(attachment_str, "[START OF TRACE]", "[END OF TRACE]")
    code_section = section_between(attachment_str, "[START OF CODE]", "[END OF CODE]")

    # parse startTime and endTime (floats)
    def parse_time(section: str, name: str):
        m = re.search(rf"{re.escape(name)}\s*:\s*([0-9eE\+\-\.]+)", section)
        if not m:
            return None
        return float(m.group(1))

    start_time = parse_time(trace_section, "startTime")
    end_time = parse_time(trace_section, "endTime")

    # parse selectedComponentNameList (JSON array)
    comp_list_json = find_json_array(trace_section, "selectedComponentNameList")
    if comp_list_json is None:
        selected_component_list = []
    else:
        selected_component_list = json.loads(comp_list_json)

    # compute selected count
    selected_count = len(selected_component_list)

    # parse selectedGitHubRoutineKeys from code section
    gh_keys_json = find_json_array(code_section, "selectedGitHubRoutineKeys")
    if gh_keys_json is None:
        selected_github_keys = []
    else:
        selected_github_keys = json.loads(gh_keys_json)

    trace_info = {
        "startTime": start_time,
        "endTime": end_time,
        "selected": selected_count,
        "selectedComponentNameList": selected_component_list
    }

    return trace_info, selected_github_keys
    

def get_auto_attachment(messages, default_trace, benchmark=None, question_id=None, logging=True):
    q_text = messages[-1]['content'][0]["text"]
    assert q_text is not None and len(q_text) > 0, "Question text is empty"
    full_q_text = q_text + "\n\n" + ATTACHMENT_REQUEST_PROMPT.format(
        json.dumps(get_compnames(), indent=2)
    )
    full_messages = copy.deepcopy(messages)
    full_messages[-1]['content'][0]["text"] = full_q_text

    payload = {
        "messages": full_messages,
        "traceInfo": default_trace,
        "selectedGitHubRoutineKeys": []
    }
    
    resp = requests.post("http://localhost:3001/api/gpt", json=payload, timeout=100)
    # status_code = resp.status_code

    resp_json = resp.json()

    choices = resp_json.get("choices", [])
    content_str = ""
    if choices and isinstance(choices, list):
        first = choices[0].get("message", {}).get("content")
        if isinstance(first, str):
            content_str = first
        else:
            # if content is structured, convert to string
            content_str = json.dumps(first)
    print(f"{content_str}")

    trace_info, selected_github_keys = convert_attachment_str_to_dicts(content_str)

    if logging:
        log_question_attachment_to_local_file(benchmark, question_id, trace_info, selected_github_keys)
    
    return trace_info, selected_github_keys

def log_question_attachment_to_local_file(benchmark, question_id, trace_info, selected_github_keys):
    folder = "./attachment_log"
    assert benchmark is not None, "benchmark is None"
    assert question_id is not None, "question_id is None"
    os.makedirs(folder, exist_ok=True)

    bench = str(benchmark)
    qid = str(question_id)
    # sanitize filename (avoid path separators)
    safe = lambda s: s.replace(os.sep, "_")
    filename = safe(f"{bench}_{qid}.json")
    path = os.path.join(folder, filename)

    payload = {
        "benchmark": benchmark,
        "question_id": question_id,
        "traceInfo": trace_info,
        "selectedGitHubRoutineKeys": selected_github_keys
    }

    with open(path, "w", encoding="utf-8") as f:
        json.dump(payload, f, indent=2, ensure_ascii=False)

    return path

